import { FuseLoadable } from "owp/@fuse";

export const C0306000Config = {
    settings: {
        layout: {
            config: {
                navbar        : {
                    display: true
                },
                toolbar       : {
                    display: true
                },
                footer        : {
                    display: true
                },
                leftSidePanel : {
                    display: true
                }
            }
        }
    },
    routes  : [
        {
            path     : '/pages/C0306000',
            component: FuseLoadable({
                loader: () => import('./C0306000')
            })
        }
    ]
};
